import React from 'react';
import './App.css';
import Dataspec from "./dataspec/Dataspec"

class App extends React.Component{ 

  constructor(props) {
    super(props);
    this.state = {displayComponent:"Dataspec"};
  }

 render(){
  return (
    <div className="App">
      <Header className="Header"/>
      {renderComponent(this.state.displayComponent)}
      <Footer />
    </div>
  );
}
}

function renderComponent(displayComponent)
{
  console.log(displayComponent)
  if(displayComponent=="Dataspec")
  {
  return <Dataspec/>
  }
}

function Header(){

  return(
    <>
     <div className="w3-bar w3-white w3-border-bottom w3-xlarge">
     <a href={"#"} className="w3-bar-item w3-button w3-text-red w3-hover-red"><b><i className={"fa fa-th-list w3-margin-right"}></i>GenoRec</b></a>
     <a href="#" className="w3-bar-item w3-button w3-right w3-mobile">Tutorial</a>
    </div>
    </>
  )
}

function Footer(){
  return (
  <>
  <footer className="w3-container w3-center w3-opacity w3-margin-bottom">
  <h5>MIT License</h5>
  <p>Created by <a href="https://www.aditeyapandey.com/" target="_blank" className="w3-hover-text-green">Aditeya Pandey</a></p>
 </footer>
  </>
  )
}




export default App;
